  `triwulan4` decimal(18,0) DEFAULT NULL,
  KEY `nodpa` (`nodpa`),
  KEY `keykegiatan` (`keykegiatan`),
  KEY `keyakun5` (`keyakun5`),
  CONSTRAINT `dpadetail_ibfk_1` FOREIGN KEY (`nodpa`) REFERENCES `dpa` (`nodpa`),
